// SPDX-License-Identifier: MIT

pragma solidity ^0.8.0;

// ==================== Internal Imports ====================

import {Erc20Bank} from "./Erc20Bank.sol";

/**
 * @title PixelCoinBank
 * @author Matrix
 */
contract PixelCoinBank is Erc20Bank {
    // ==================== Constructor function ====================

    constructor(
        address stakeToken,
        address rewardToken,
        uint256 maxReward,
        uint256 rewardPerBlock,
        uint256 startBlock
    ) Erc20Bank(stakeToken, rewardToken, maxReward, rewardPerBlock, startBlock) {}
}
